@import url('https://rsms.me/inter/inter.css');
html { font-family: 'Inter', sans-serif; }
@supports (font-variation-settings: normal) {
  html { font-family: 'Inter var', sans-serif; }
}

sources.styles/blocks/page.scss:
.page {
  box-sizing: border-box;
  font-family: 'Inter', sans-serif;
  background-color: $main-color;
  font-weight: 400;
  font-size: 16px;
  color: $dark-color;
  scroll-behavior: smooth;

  &__body {
    margin: 0;
  }
}

sources.styles/blocks/header.scss:
.header {
  &__top-links {
    padding: 20px 18px 50px 20px;
    display: flex;
    justify-content: space-between;
    align-items: center;

    @media (min-width: 640px) {
      padding: 20px 18px 100px 20px;
    }
    @media (min-width: 1024px) {
      padding: 32px 32px 32px 36px;
    }
  }
  &__logo {
    pointer-events: all;
    cursor: pointer;
    @media (min-width: 1024px) {
      z-index: 1;
    }
  }

  &__logo-img {
    display: block;
    height: 24px;
    width: 128px;
  }

  &__menu-img {
    display: block;
    height: 8px;
    width: 20px;
    @media (min-width: 1024px) {
      display: none;
    }
  }
  &__heading {
    font-size: 64px;
    line-height: 54px;
    text-align: center;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $accent-color;
    font-weight: 400;
    margin: 0;

    @media (min-width: 640px) {
      grid-column: 1 / 9;
      grid-row: 2 / 3;

      font-size: 80px;
      line-height: 68px;
    }

    @media (min-width: 1024px) {
      font-size: 136px;
      z-index: 1;
      grid-column: 1 / 9;
      grid-row: 3 / 4;
      line-height: 116px;
    }

    @media (min-width: 1280px) {
      font-size: 144px;
    }
  }

  &__info {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    margin: 0 auto 104px auto;

    @media (min-width: 640px) {
      display: grid;
      grid-template-columns: repeat(8, minmax(48px, 64px));
      grid-template-rows: 48px 328px 156px;
      align-items: center;
      grid-column-gap: 24px;
      margin: 0 44px 228px 44px;
    }
    @media (min-width: 1024px) {
      grid-template-columns: repeat(8, minmax(96px, 118px));
      grid-template-rows: 135px 72px 116px 184px;
      margin-bottom: 218px;
    }
    @media (min-width: 1200px) {
      grid-template-columns: repeat(8, minmax(122px, 128px));
      margin-bottom: 178px;
    }
  }

  &__text {
    line-height: 24px;
    text-align: center;
    letter-spacing: -0.01em;
    margin: 0 0 32px 0;

    @media (min-width: 640px) {
      grid-column: 1 / 5;
      grid-row: 1 / 2;
      text-align: left;
      margin: 0;
    }
    @media (min-width: 1024px) {
      grid-column: 1 / 3;
      grid-row: 2 / 3;
      margin-bottom: 16px;
    }

  }

  &__main-img {
    width: 288px;
    height: 290px;

    @media (min-width: 640px) {
      grid-column: 3 / 7;
      grid-row: 2 / 3;
      width: 326px;
      height: 328px;
      z-index: -1;
    }
    @media (min-width: 1024px) {
      grid-column: 3 / 7;
      grid-row: 1 / 5;
      width: 544px;
      height: 546px;
    }
  }

  &__info-btn {
    text-decoration: none;
    display: flex;
    justify-content: center;
    align-items: center;
    width: 288px;
    height: 56px;
    border: 2px solid $accent-color;
    border-radius: 32px;
    font-weight: 500;
    font-size: 16px;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: $accent-color;
    box-sizing: border-box;
    transition: background-color $time,
                color $time,
                fill $time;

    &:hover {
      background-color: $accent-color;
      color: $white-color;
    }
    &:focus {
      background-color: #B2341A;
      border-color: #B2341A;
      color: $white-color;
    }
    &:hover .header__info-img path {
      fill: $white-color;
    }
    &:focus .header__info-img path {
      fill: $white-color;
    }

    @media (min-width: 640px) {
      grid-column: 3 / 7;
      grid-row: 3 / 4;
      width: 326px;
    }
    @media (min-width: 1024px) {
      grid-column: 1 / 3;
      grid-row: 4 / 5;
      width: 260px;
    }

  }

  &__info-img {
    display: block;
    width: 20px;
    height: 20px;
    margin-right: 6px;
  }
}

sources.styles/blocks/menu.scss:
.menu {
  background-color: $main-color;
  box-sizing: border-box;
  height: 100vh;
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  transform: translateX(-100%);
  transition: transform 0.3s;

  @media (min-width: 1024px) {
    transform: translateX(0);
    height: 88px;
    background: none;
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
  }

  &:target {
    transform: translateX(0);
  }

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 20px 18px 20px;

    @media (min-width: 1024px) {
      display: none;
      z-index: -1;
    }
  }

  &__list {
    list-style: none;
    padding: 0;
    margin-top: 132px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    @media (min-width: 640px) {
      margin-top: 200px;
    }
    @media (min-width: 1024px) {
      flex-direction: row;
      justify-content: end;
      align-items: center;
      margin-top: 32px;
    }
  }

  &__item {
    margin-bottom: 24px;

    &:nth-child(3) {
      margin-bottom: 32px;
    }
    &:last-child {
      color: $accent-color;
      letter-spacing: 0.02em;
      text-transform: uppercase;
    }

    @media (min-width: 1024px) {
      display: block;
      margin-right: 64px;

      &:nth-child(3) {
        margin-bottom: 24px;
      }
    }
  }

  &__link {
    text-decoration: none;
    cursor: pointer;
    color: inherit;
    line-height: 24px;
    text-align: center;
    letter-spacing: -0.01em;
    display: flex;
    align-items: center;
    justify-content: center;
    transition: color $time,
                border-bottom $time;
    &:hover {
      color: $accent-color;
      border-bottom:1px solid $accent-color;
    }
  }

  &__phone {
    display: block;
    margin-right: 8px;
  }
}

sources.styles/blocks/products.scss:
.products {
  padding: 0 16px;
  display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
  @media (min-width: 768px) {
    display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      padding: 0 44px;
    }
    @media (min-width: 1024px) {
      padding: 0;

    }

  &__heading {
    margin: 0 0 24px 0;
    width: 100%;
    font-weight: 400;
    font-size: 48px;
    line-height: 41px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $accent-color;
  }

  &__info {
    width: 100%;
    font-size: 16px;
    line-height: 24px ;
    letter-spacing: -0.01em;
    margin-bottom: 56px;
  }

  &__catalog {
    display: grid;
    grid-template-columns: repeat(2, 136px);
    gap: 16px;
    justify-content: center;
    align-items: center;
    @media (min-width: 768px) {
      grid-template-columns: repeat(8, 64px);
      gap: 24px;
      margin-bottom: 104px;
    }
    @media (min-width: 1200px) {
      grid-template-columns: repeat(8, 118px);
    }
    @media (min-width: 1280px) {
      grid-template-columns: repeat(8, 128px);
    }
  }
}

sources.styles/blocks/product.scss:
.product {
  display: flex;
  flex-direction: column;
  width: 288px;
  height: 494px;
  margin-bottom: 56px;
  grid-column: 1 / 3;
  &:last-of-type {
    margin-bottom: 80px;
  }

  @media (min-width: 768px) {
    width: 328px;
    height: 560px;
    &--1,
    &--3 {
      grid-column: 1 / 5;
    }

    &--2,
    &--4 {
      grid-column: 5 / 9;
    }
    &:last-of-type {
    margin-bottom: 56px;
  }
  }
    @media (min-width: 1200px) {
      width: 402px;
      height: 648px;
      &--1 {
        grid-column: 1 / 4;
      }
      &--2 {
        grid-column: 4 / 7;
      }
      &--3 {
        grid-column: 3 / 6;
      }
      &--4 {
        grid-column: 6 / 9;
      }
    }
    @media (min-width: 1280px) {
      width: 432px;
      height: 696px;
    }


  &__img {
    display: block;
    margin-bottom: 16px;
    width: 288px;
    height: 356px;
    border-radius: 8px;
    transition: transform $time;
    cursor: pointer;
    @media (min-width: 768px) {
      width: 328px;
      height: 424px;
    }
    @media (min-width: 1200px) {
      width: 402px;
      height: 512px;
    }
    @media (min-width: 1280px) {
      width: 432px;
      height: 560px;
    }
    &:hover {
      transform: scale(1.03);
    }
  }

  &__name {
    font-weight: 500;
    font-size: 16px;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: $light-text-color;
    margin: 0 0 8px 0;

  }

  &__description {
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    color: $dark-color;
    margin: 0 0 24px 0;
  }

  &__btn {
    display: flex;
    align-items: center;
    font-weight: 500;
    font-size: 16px;
    line-height: 16px;
    letter-spacing: 0.02em;
    text-transform: uppercase;
    color: $accent-color;
    text-decoration: none;
    transition: border-bottom $time;
    width: max-content;

    &:hover {
      border-bottom:1px solid $accent-color;
    }

  }

  &__btn-img {
    display: block;
    width: 16px;
    height: 16px;
    margin-right: 8px;
    padding-left: 4px;
  }

}

sources.styles/blocks/about.scss:
.about {
  position: relative;
  margin: 0 auto;

  &__background {
    position: absolute;
    top: 600px;
    z-index: -1;
    height: 300px;
    width: 320px;
    @media (min-width: 768px) {
      height: 492px;
      width: 526px;
      top: 50px;
      left: 120px;
    }
    @media (min-width: 1200px) {
      height: 672px;
      width: 718px;
      top: 0;
      left: 324px;
    }
    @media (min-width: 1280px) {
      left: 360px;
    }
  }

  &__content {
    display: grid;
    grid-template-columns: repeat(2, 136px);
    gap: 16px;
    justify-content: center;
    align-items: center;
    @media (min-width: 768px) {
      align-items:flex-start;
      grid-template-columns: repeat(8, 64px);
      grid-template-rows: 280px 82px 96px 82px 24px;
      column-gap: 24px;
      row-gap: 8px;
    }
    @media (min-width: 1200px) {
      grid-template-columns: repeat(8, 118px);
      grid-template-rows: 258px 82px 24px;
    }
    @media (min-width: 1280px) {
      grid-template-columns: repeat(8, 128px);
    }
  }

  &__heading {
    font-weight: 400;
    font-size: 48px;
    line-height: 41px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $accent-color;
    grid-column: 1 / 3;
    margin-bottom: 32px;
    @media (min-width: 768px) {
      grid-column: 1 / 5;
      font-size: 56px;
      line-height: 48px;
    }
     @media (min-width: 1200px) {
      grid-column: 1 / 5;
      grid-row: 1 / 2;
      font-size: 72px;
      line-height: 61px;
    }
  }

  &__description {
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    grid-column: 1 / 3;
    margin-bottom: 64px;
     @media (min-width: 768px) {
      grid-column: 5 / 9;
    }
    @media (min-width: 1200px) {
      grid-column: 5 / 9;
      grid-row: 1 / 2;
    }
  }

  &__number {
    font-weight: 400;
    font-size: 96px;
    line-height: 82px;
    letter-spacing: -0.05em;
    text-transform: uppercase;
    color: $accent-color;
    grid-column: 1 / 3;
    margin-bottom: 8px;
  }

  &__text {
    font-size: 16px;
    line-height: 24px;
    letter-spacing: -0.01em;
    grid-column: 1 / 3;
    margin-bottom: 48px;
  }
  &__number--year {
    @media (min-width: 768px) {
      grid-column: 1 / 4;
      grid-row: 2 / 3;
    }
    @media (min-width: 1024px) {
      grid-column: 1 / 3;
      grid-row: 2 / 3;
    }
  }
  &__number--stores {
    @media (min-width: 768px) {
      grid-column: 5 / 7;
      grid-row: 2 / 3;
    }
    @media (min-width: 1024px) {
      grid-column: 3 / 4;
      grid-row: 2 / 3;
    }
  }
  &__text--year {
    @media (min-width: 768px) {
      grid-column: 1 / 4;
      grid-row: 3 / 4;
    }
    @media (min-width: 1024px) {
      grid-column: 1 / 3;
      grid-row: 3 / 4;
    }
  }
  &__text--stores {
     @media (min-width: 768px) {
      grid-column: 5 / 7;
      grid-row: 3 / 4;
    }
     @media (min-width: 1024px) {
      grid-column: 3 / 4;
      grid-row: 3 / 4;
    }
  }
  &__number--companies {
     @media (min-width: 768px) {
      grid-column: 1 / 4;
      grid-row: 4 / 5;
    }
    @media (min-width: 1024px) {
      grid-column: 5 / 7;
      grid-row: 2 / 3;
    }
  }
  &__number--clients {
    @media (min-width: 768px) {
      grid-column: 5 / 7;
      grid-row: 4 / 5;
    }
    @media (min-width: 1024px) {
      grid-column: 7 / 9;
      grid-row: 2 / 3;
    }
  }

  &__text--companies {
    @media (min-width: 768px) {
      grid-column: 1 / 4;
      grid-row: 5 / 6;
    }
    @media (min-width: 1024px) {
      grid-column: 5 / 6;
      grid-row: 3 / 4;
    }
  }
  &__text--clients {
    @media (min-width: 768px) {
      grid-column: 5 / 7;
      grid-row: 5 / 6;
    }
    @media (min-width: 1024px) {
      grid-column: 7 / 8;
      grid-row: 3 / 4;
    }
  }
}

